import React, { useState, useEffect } from "react";
import { fetchDailyPnls } from "../api/DailyPNLApi";
import {
  ScatterChart,
  Scatter,
  XAxis,
  YAxis,
  Tooltip,
  ResponsiveContainer,
} from "recharts";
import { formatCash, formatDate } from "../func/functions";

const InvestmentChart = () => {
  const [dailyPNLData, setDailyPNLData] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [view, setView] = useState("1W"); // default to 1 Week view
  const [chartData, setChartData] = useState([]);

  useEffect(() => {
    const fetchDailyPNLData = async () => {
      try {
        const data = await fetchDailyPnls();
        setDailyPNLData(data);
      } catch (error) {
        setError("No Daily PNL data");
        console.error("Error fetching daily PNL data:", error);
      } finally {
        setLoading(false);
      }
    };

    fetchDailyPNLData();
  }, []);

  useEffect(() => {
    if (!dailyPNLData.length) return;

    switch (view) {
      case "1W":
        setChartData(formatChartData(getCurrentWeek(dailyPNLData)));
        break;
      case "1M":
        setChartData(formatChartData(getCurrentMonth(dailyPNLData)));
        break;
      case "3M":
        setChartData(formatChartData(getLastThreeMonths(dailyPNLData)));
        break;
      default:
        setChartData(formatChartData(dailyPNLData));
        break;
    }
  }, [dailyPNLData, view]);

  const formatChartData = (data) => {
    return data.map((entry) => ({
      date: formatDate(entry.entry_date),
      balance: parseFloat(entry.balance || 0),
    }));
  };

  // 1W - Last 7 Days
  const getCurrentWeek = (data) => {
    const today = new Date();
    const startOfWeek = new Date(today);
    startOfWeek.setDate(today.getDate() - today.getDay());

    return data.filter((entry) => {
      const entryDate = new Date(entry.entry_date);
      return entryDate >= startOfWeek && entryDate <= today;
    });
  };

  // 1M - Last 1 Month
  const getCurrentMonth = (data) => {
    const today = new Date();
    const startOfMonth = new Date(today.getFullYear(), today.getMonth(), 1);

    return data.filter((entry) => {
      const entryDate = new Date(entry.entry_date);
      return entryDate >= startOfMonth && entryDate <= today;
    });
  };

  // 3M - Last 3 Months
  const getLastThreeMonths = (data) => {
    const today = new Date();
    const startOfThreeMonths = new Date(today);
    startOfThreeMonths.setMonth(today.getMonth() - 2);

    return data.filter((entry) => {
      const entryDate = new Date(entry.entry_date);
      return entryDate >= startOfThreeMonths && entryDate <= today;
    });
  };

  return (
    <div className="investment-chart-container">
      <div className="header-card">
        <div className="tab-container">
          <button
            className={`tab-button ${view === "1W" ? "active" : ""}`}
            onClick={() => setView("1W")}
          >
            1W
          </button>
          <button
            className={`tab-button ${view === "1M" ? "active" : ""}`}
            onClick={() => setView("1M")}
          >
            1M
          </button>
          <button
            className={`tab-button ${view === "3M" ? "active" : ""}`}
            onClick={() => setView("3M")}
          >
            3M
          </button>
        </div>
      </div>

      {loading ? (
        <div>Loading...</div>
      ) : error ? (
        <div>{error}</div>
      ) : (
        <ResponsiveContainer width="100%" height={300}>
          <ScatterChart>
            <XAxis dataKey="date" type="category" />
            <YAxis dataKey="balance" hide={true} />
            <Tooltip formatter={(value) => formatCash(value)} />
            <Scatter data={chartData} fill="#4a90e2" />
          </ScatterChart>
        </ResponsiveContainer>
      )}
    </div>
  );
};

export default InvestmentChart;
